    private url: string;

    constructor(url: string) {
        this.url = 'http://localhost:3000'; // url;
    }

    public async listRestaurants() {
        return await fetch(`${this.url}/v1/restaurants/5e5aa69e21d239a34cee1264/tables`)
    }
}
